import { Component, OnInit } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';

@Component({
  selector: 'app-card-a01',
  templateUrl: './card-a01.component.html',
  styleUrls: ['./card-a01.component.css']
})
export class CardA01Component implements OnInit {

  title: string = 'Guerreiros';
  cardImage;

  constructor(private sanitizer: DomSanitizer) { }

  ngOnInit() {
    this.cardImage = this.sanitizer.bypassSecurityTrustResourceUrl(`data:image/png;base64, ${cardA01Base64}`);
  }

}

export const cardA01Base64 = "";